Howdy, y‚Äôall! My name is Amber Goodwin (she/her/hers). I am a Black woman, future lawyer (Mitchell Hamline Class of 2021), Texan, organizer, dog lover, and founder of the Community Justice Action Fund (CJAF). I‚Äôm so excited to be here and am grateful to Hailey for her continued support of our work. 

I split my time between helping to create new legal solutions as a 3L law student and building power everyday
for Black women, our families, and our communities to end gun violence by advancing policy, and changing the narrative around gun violence. I started CJAF almost 5 years ago to help fill a policy gap between what was happening in our communities everyday, the news, and policy makers. We didn‚Äôt just need a seat at a table, we needed to create our own space. For far too long Black people, and in particular women, our families, and our communities have been left out of courtrooms, Congress, the White House, and noticeably in the debate on gun laws. We are working with local, state, and federal community leaders to change that. 

Every day, gun violence kills almost 100 people just in America, and a disproportionate number of those people are Black. This women‚Äôs history month, I hope you will learn not only about our work, but the work of incredible women, mothers, sisters, daughters and friends who have been directly affected by this public health crisis. 

 I also hope many more advocates join the field of law to tackle many complex issues like gun violence. Black women are only 2% of lawyers in America, and we are rarely in the halls of law schools. Check out innovative programs like @MitchellHamline where I serve as the school‚Äôs first Black Student Bar Association President! 

I can‚Äôt wait to show you a bit of our journey and highlight our partners at CJAF for Women‚Äôs History Month.

